import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'app';
}
<!DOCTYPE html>
<HTML>
  <head>
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bulma@0.9.2/css/bulma.min.css">
    <style>
      body{
        margin:0;
        padding:0;
      }
      .navbar{

        background-color: #d0d5e1;
        border: 1px solid;
        border-color: black;

      }
    </style>  
  </head>
  <body>
    <nav class="navbar">
      <div class="container">
        <div  class="navbar-menu">
          <div class="navbar-start">
            <a class="navbar-item">
              <img src="./assets/images/educative_logo.png" width="170px;" height="100px;">
              Home page
            </a>
          </div>
        </div>
      </div>
    </nav>

    <section class="hero is-link is-fullheight-with-navbar">
      <div class="hero-body">
        <p class="title">
          Welcome to Educative
        </p>
      </div>
    </section>
  </body>
</HTML>



